import json


def generate_file(file, scentence, images):
    with open(file, "w") as file:
        for i in range(30):
            dict = {"question": scentence, "images": [images]}
            file.write(json.dumps(dict, ensure_ascii=False) + "\n")


def main():
    generate_file("qwen-vl.jsonl", "这幅图里面有什么",
                  "")


if __name__ == "__main__":
    main()
